import {Cards} from './components/Cards/Cards';
import './App.css';
import React from 'react';
import { Title } from './components/Cards/Cards';
import { Images } from './components/Cards/Cards';
import {img} from '../src/images.jpeg';

function App() {
  const r = {
    imgs: {img},
    alt: 'картинка компьютера',
    tit:'Special title treatment',
    text: 'With supporting text below as a natural lead-in to additional content.'
  }
  return (
    <Cards>
      <Images image={r.img} imageText={r.alt}/>
      <Title title={r.tit} text={r.text}/>
    </Cards>
  );
}

export default App;
